def solution(stdin: str) -> str:
    M, N = list(map(int, stdin.split()[0:2]))
    U, L, R, D = list(map(int, stdin.split()[2:6]))
    board = []
    for i in range(M):
        board.append(list(stdin.split()[i]))
    frame = ['#'] * (U*2+1) + ['.'] * ((L+R)*2+1)
    for i in range(U*2):
        if i % 2 == 0:
            frame[i] = '.'
    frame += ['#'] * (U*2+1) + ['.'] * ((L+R)*2+1)
    for i in range(U*2+1, U*2+1+L*2):
        if i % 2 == 0:
            frame[i] = '.'
    for i in range(U*2+1+L*2, U*2+1+L*2+M*2):
        if i % 2 == 1:
            frame[i] = '.'
    for i in range(U*2+1+L*2+M*2, U*2+1+L*2+M*2+R*2):
        if i % 2 == 0:
            frame[i] = '.'
    frame += ['#'] * (U*2+1) + ['.'] * ((L+R)*2+1)
    for i in range(U*2+1+L*2+M*2+R*2, U*2+1+L*2+M*2+R*2+D*2):
        if i % 2 == 1:
            frame[i] = '.'
    for i in range(U*2+1+L*2+M*2+R*2+D*2, U*2+1+L*2+M*2+R*2+D*2+U*2):
        if i % 2 == 0:
            frame[i] = '.'
    frame += ['#'] * (U*2+1) + ['.'] * ((L+R)*2+1)
    frame = [frame[i:i+N*2] for i in range(0, len(frame), N*2)]
    for i in range(U):
        for j in range(L+R+N):
            if frame[i][j] == '#':
                if j % 2 == 1 and (i == 0 or board[i//2][j//2] == '.'):
                    board[i//2][j//2] = '#' if board[i//2][j//2] == '.' else board[i//2][j//2]
    for i in range(M):
        for j in range(N):
            if board[i][j] == '#':
                frame[U+i][L+R+j] = '#' if board[i][j] == '#' else '.'
    return '
'.join([''.join(row) for row in frame])
